        const testTime  = Array.from({length: energyData.length}, (_, i) => i*0.5);


        
        //temp function used for testing the page
        function updatePlot(){
            CCA_results = CCA(energyData,true) ; 
        
            fillCCTable(CCA_results)
            
            let PowerData = energyData;
            let Eaccum = energyData.map((sum => value => sum += value)(0))
            
            
            //adding the three fixed traces ('fixed' for given data)
            Plotly.react('Power_Plot',
                [{x: testTime ,y: PowerData}], 
                {title: 'Power timeseries', xaxis:{title: 'Time (hr)'},yaxis:{title: 'Power (P Units)'} }
                );

            
            Plotly.react('Energy_Plot',
                [{x: testTime,y: Eaccum}],
                {title: 'Energy timeseries',xaxis:{title: 'Time (hr)'},yaxis:{title: 'Energy (E Units)'},hovermode: 'x unified' }
                );
            
            Plotly.react('GES_ES_Plot',
                [ {name:'GSE v E',x: CCA_results.CritCap.Load,y: CCA_results.GSE , mode: 'lines+markers' , hovertemplate: 'GSE: %{y:.2f}' + '<br>' + '  Es: %{x:.2f}' + '<extra></extra>'} ], 
                {title: 'GSE to Es trade-off', showlegend: false, xaxis:{title: 'Storage Capacity (E Units)'},yaxis:{title: 'GSE (E Units)'}}
                );
            
            
            //adding the 
            //~ T_cc2 = CCA_results.CCTS.Load[1];
            //~ console.log( T_cc2)
            Plotly.react('CCi_P_Plot',
                [{x: testTime ,y: PowerData}], 
                {title: 'Power for CC 2 series',hovermode: 'x unified', hovertemplate: 'P: %{y}' + '<br>' + 'T: %{x}' + '<extra></extra>' , yaxis: {title: 'Power (P units)', fixedrange: true}, xaxis : {title: 'Time (hr)', fixedrange: true} }
                );
                
            Plotly.react('CCi_E_Plot',
                [{x: testTime ,y: Eaccum}], 
                {title: 'Energy for CC 2 series', hovermode: 'x unified', hovertemplate: 'E: %{y}' + '<br>' + 'T: %{x}' + '<extra></extra>'  ,  yaxis: {title: 'Energy (E units)', fixedrange: true}, xaxis : {title: 'Time (hr)', fixedrange: true}} 
                );
            
            
        }
        </script>

        <div class="row">
            <div class="column" id="Power_Plot">        </div>
            <div  class="column" id="Energy_Plot">      </div>
        </div>
        
        <div class="row">
            <div  class="column" id="GES_ES_Plot">      </div>
                <div class="column">
                    <table id='tableDataDisplay'>

                            <th class='MyHdr'> CC Magnitude</th>

                            <th class='MyHdr'> CC Te </th>
                            <th class='MyHdr'> Inner CC #</th>
                    </tr>
                    </table>
                </div>
        </div>
        
        <div  class="row" id="CCi_P_Plot">  </div>
        <div  class="row" id="CCi_E_Plot">  </div>
    </body>
